  return (
    <div className="">
      {groups.map(group => (
        <div className="group" key={ group.groupID } >
          <Link to = {`/group/${group.groupID}`}>
           <h4>{ group.groupName }</h4>
          </Link>
          <p>{ group.groupID }</p>
        </div>
      ))}
    </div>
  );
}


export default Groups;



